import java.util.HashMap;
import java.util.Map;

public class FindDifference {
    public static void main(String[] args) {
        String s = "", t = "";
        System.out.println("The result after solving using Array approach: " + solveUsingArray(s, t));
        System.out.println("The result after solving using Map approach: " + solveUsingMap(s, t));
        System.out.println("The result after solving using Integer difference approach: " + solveUsingIntegerDifference(s, t));
    }

    private static char solveUsingIntegerDifference(String s, String t) {
        int sumStringT = 0;
        for (char c : t.toCharArray())
            sumStringT += c;

        for (char c : s.toCharArray())
            sumStringT -= c;

        return (char) sumStringT;
    }

    private static char solveUsingMap(String s, String t) {
        Map<Character, Integer> map = new HashMap<>();
        for (char c : t.toCharArray())
            map.put(c, map.getOrDefault(c, 0) + 1);

        for (char c : s.toCharArray())
            map.put(c, map.get(c) - 1);


        return map.entrySet().stream().filter(entry -> entry.getValue() == 1).map(Map.Entry::getKey).findFirst().orElse(' ');
    }

    public static char solveUsingArray(String s, String t) {
        int[] countArray = new int[123];
        for (char c : t.toCharArray())
            countArray[c]++;
        for (char c : s.toCharArray())
            countArray[c]--;
        for (int i = 0; i < countArray.length; i++)
            if (countArray[i] == 1) return (char) i;
        return ' ';
    }
}
